DROP TABLE IF EXISTS "Invoice" CASCADE;

-- Najprv vytvorime tabulku kde sa nachadza specifikacia stlpaca pre customer
CREATE TABLE "Invoice"
(
    "InvoiceId" INT NOT NULL,
    "CustomerId" INT NOT NULL,
    "InvoiceDate" TIMESTAMP NOT NULL,
    "BillingAddress" VARCHAR(70),
    "BillingCity" VARCHAR(40),
    "BillingState" VARCHAR(40),
    "BillingCountry" VARCHAR(40),
    "BillingPostalCode" VARCHAR(10),
    "Total" NUMERIC(10,2) NOT NULL,
    CONSTRAINT "PK_Invoice" PRIMARY KEY  ("InvoiceId")
);



-- Najdite take Inovoice ktorych total je nadpriemerny 
-- Prvy napad
-- SELECT *
-- FROM "Invoice"
-- WHERE "Total" > AVG("Total")
-- PROBLEM agregacna funkcia sa neda pouzit vo WHERE klauzule iba v SELECTE ako to teda spravit

-- Najdem si priemer Total
SELECT AVG("Total")
FROM "Invoice"

SELECT * 
FROM "Invoice"
WHERE "Total" > 5.6519417475728155


-- Riesenie pomocou subquery 
SELECT * 
FROM "Invoice"
WHERE "Total" > (
	SELECT AVG("Total")
	FROM "Invoice"
)

-- Priklad
-- Sucet cien Invoicov takych zakaznikov ktory mali 4 a viac invoicov
SELECT SUM("Total") 
FROM "Invoice"
WHERE "CustomerId" IN (
	SELECT "CustomerId"
	FROM "Invoice"
	GROUP BY "CustomerId"
	HAVING COUNT(*) >=4
)




